import React from 'react';
import Navbar from './navbar';

const Body = () => {
    return(
        <div>
            <Navbar/>
            {['Hello', 'Wassup', 'Hey there'].map((stuff)=>{
                return <div>
                    <p>{stuff} 0 <button>Add</button><button>Remove</button></p>
                </div>
            })}
        </div>
    );
}

export default Body;
